      <div id="button_container1" class="button_container" style="background-color: rgb(254, 254, 254);">
        <select name="timespan" id="timespan" style="display: none; font-size: 0.7em;">
          <option value="2">2 hours</option>
          <option value="6">6 hours</option>
          <option value="24" selected="">1 day</option>
          <option value="72">3 days</option>
          <option value="168">7 days</option>
          <option value="720">30 days</option>
          <option value="1296">54 days</option>
          <option value="8760">1 year</option>
          <option value="43800">5 years</option>
          <option value="all">All</option>
        </select><span class="ui-selectmenu-button ui-widget ui-state-default ui-corner-all" tabindex="0" id="timespan-button" role="combobox" aria-expanded="false" aria-autocomplete="list" aria-owns="timespan-menu" aria-haspopup="true" aria-activedescendant="ui-id-8" aria-labelledby="ui-id-8" aria-disabled="false" style="width: 16.8%;"><span class="ui-icon ui-icon-triangle-1-s"></span><span class="ui-selectmenu-text">1 day</span></span>
        <button id="series_dialog_button" class="option_button" style="color: rgb(68, 68, 68); font-size: 0.7em;">Series</button>
        <button id="save_button" class="option_button" style="color: rgb(68, 68, 68); font-size: 0.7em;">Save as text</button>
        <button id="save_image_button" class="option_button" style="color: rgb(68, 68, 68); font-size: 0.7em;">Save as Image</button>
        <button id="option_dialog_button" class="option_button" style="color: rgb(68, 68, 68); font-size: 0.7em;">Options</button>
      </div>
    
      <div id="loading_div" style="display: none;">
        <!-- image src doesn't need 'drupal-staging' if not on vm -->
        &lt;%--<div id="loading_icon_div"><img id="loading_image" src="/sites/all/modules/custom/swx_rtsw/images/ajax-loader.gif"></div>--%&gt;
        <div id="loading_icon_div"><img id="loading_image" src="resources/images/ajax-loader.gif"></div>
        <div id="loading_text_div">Loading...</div>
      </div>
    </div>
    
    <!-- the series selection modal dialog -->
    <div id="series_dialog" hidden="">
      <!-- select the source spacecraft -->
      <label>
        <input type="radio" id="radio_source_2" name="sourcescheme" value="2" checked="">
        Active spacecraft
      </label><br>
      <label>
        <input type="radio" id="radio_source_1" name="sourcescheme" value="1">
        DSCOVR only
      </label><br>
      <label>
        <input type="radio" id="radio_source_0" name="sourcescheme" value="0">
        ACE only
      </label><br>
      <hr>
      <!-- select the data series to show -->
      <label>
        <input type="radio" id="radio_series_0" name="seriesscheme" value="0">
        Mag
      </label><br>
      <label>
        <input type="radio" id="radio_series_1" name="seriesscheme" value="1">
        Solar Wind
      </label><br>
      <label>
        <input type="radio" id="radio_series_2" name="seriesscheme" value="2" checked="">
        Mag + Wind
      </label><br>
      <!-- toggle showing the Kp Ap -->
      <label>
        <input type="checkbox" id="checkbox_kpap" name="kpapscheme" value="true">
        Planetary Kp + Ap
      </label><br>
      <hr>
      <!-- toggle showing the Enlil predicted wind overlay -->
      <label>
        <input type="checkbox" id="checkbox_recurrence" name="recurrencescheme" value="true">
        Overlay recurrence
      </label><br>
      <!-- toggle showing the Enlil predicted wind overlay -->
      <label>
        <input type="checkbox" id="checkbox_enlil" name="enlilscheme" value="true">
        Overlay WSA-Enlil predictions
      </label><br>
      <!-- toggle showing the Geospace predicted mag+wind overlay -->
      <label>
        <input type="checkbox" id="checkbox_geospace" name="geospacescheme" value="true">
        Overlay Geospace predictions
      </label><br>
      <hr>
      <!-- manually enter the Y-axis scales -->
      <select id="seriesgroup">
        <!-- the value numbers must correspond to the plot numbers as defined in the swx_rtsw file -->
        <option value="3">Bt+Bz</option>
        <option value="1">Bz</option>
        <option value="0">Bt+Bx+By</option>
        <option value="5">Density</option>
        <option value="6">Speed</option>
        <option value="7">Temperature</option>
      </select>
      <br>
    
      <div>
        <label>
          <input type="text" id="y_max_input">
          Y Max
        </label><br>
        <label>
          <input type="text" id="y_min_input">
          Y Min
        </label>
      </div>
      <table>
        <tbody><tr>
          <td>
            <button id="y_scale_clear_button" class="dialog_button">Clear</button>
          </td>
          <td>
            <button id="y_scale_clear_all_button" class="dialog_button">Clear all</button>
          </td>
        </tr>
      </tbody></table>
      <hr>
      <!-- manually enter the zoom start/end times -->
      <label>
        <input type="text" id="zoom_start_input">
        Zoom start
      </label><br>
      <label>
        <input type="text" id="zoom_end_input">
        Zoom end
      </label>
    
      <div>2016-02-08 [09:30:26]</div>
    </div>
    
    <!-- the options modal dialog -->
    <div id="options_dialog" hidden="">
      <label>
        <input type="radio" id="radio_black" name="colorscheme" value="Black">
        Black background
      </label><br>
      <label>
        <input type="radio" id="radio_white" name="colorscheme" value="White">
        White background
      </label><br>
      <hr>
      <label>
        <input type="radio" id="radio_marker" name="renderscheme" value="Marker">
        Marker
      </label><br>
      <label>
        <input type="radio" id="radio_line" name="renderscheme" value="Line">
        Line
      </label><br>
      <label>
        <input type="radio" id="radio_hybrid" name="renderscheme" value="Hybrid">
        Hybrid (Line &lt;= 6 hrs, Marker &gt; 6 hrs)
      </label><br>
      <hr>
      <label>
        <input type="radio" id="radio_left" name="ylabelscheme" value="Left">
        Left Y-axis labels
      </label><br>
      <label>
        <input type="radio" id="radio_alternating" name="ylabelscheme" value="Alternating">
        Alternating Y-axis labels
      </label><br>
      <hr>
      <label>
        <input type="checkbox" id="checkbox_flag" name="flagscheme" value="true" checked="">
        Show flags
      </label><br>
    </div>
    
    <div id="feedback" style="color: slategray;"></div></div>
